// TradeForm.js

import React, { useState } from "react";
import { successModal, unsuccessModal } from "./Utility";

const TradeForm = () => {
  const [showModal, setShowModal] = useState(false);

  const [newTrade, setNewTrade] = useState({
    symbol: "",
    option_type: "",
    strike_price: 0,
    exp_date: "",
    entry_price: 0,
    exit_price: 0,
    contracts: 0,
    entry_date: "",
    close_date: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewTrade((prevTrade) => ({
      ...prevTrade,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8000/trades/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(newTrade),
      });
      if (response.ok) {
        successModal();
      } else {
        console.error("Failed to submit trade");
      }
    } catch (error) {
      unsuccessModal(error.message);
    }
  };

  const openModal = () => {
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
  };
  return (
    <div className="trade-form">
      <button onClick={openModal}>Open Form Modal</button>
      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={closeModal}>
              &times;
            </span>
            <div className="header-card">
              <p>New Trade</p>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Option Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={newTrade.symbol}
                onChange={handleChange}
              />
              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={newTrade.option_type}
                onChange={handleChange}
              />
              <label htmlFor="strike_price">Strike Price:</label>
              <input
                type="text"
                name="strike_price"
                value={newTrade.strike_price}
                onChange={handleChange}
              />
              <label htmlFor="exp_date">Expiration Date:</label>
              <input
                type="date"
                name="exp_date"
                value={newTrade.exp_date}
                onChange={handleChange}
              />
              <label htmlFor="entry_price">Entry Price:</label>
              <input
                type="text"
                name="entry_price"
                value={newTrade.entry_price}
                onChange={handleChange}
              />
              <label htmlFor="exit_price">Exit Price:</label>
              <input
                type="text"
                name="exit_price"
                value={newTrade.exit_price}
                onChange={handleChange}
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={newTrade.contracts}
                onChange={handleChange}
              />
              <label htmlFor="entry_date">Entry Date:</label>
              <input
                type="date"
                name="entry_date"
                value={newTrade.entry_date}
                onChange={handleChange}
              />
              <label htmlFor="close_date">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={newTrade.close_date}
                onChange={handleChange}
              />
              <button type="submit">Submit</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
  return (
    <div className="trade-form">
      <div className="header">
        <p>New Trade</p>
      </div>
      <form className="new-trade-form" onSubmit={handleSubmit}>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default TradeForm;
